import React, {Component} from 'react';

function Navbar(){
  return(
    <nav>
      <ul>
        <li><a href="#"><h3>DigitalQ</h3></a></li>
        <li><a href="#about">About</a></li>
        <li><a href="#product">Product</a></li>
        <li><a href="#contact">Contact</a></li>
        <li><a href="review">Review</a></li>
        <li><a href="login">LOGIN</a></li>
      </ul>
      <hr></hr>
    </nav>
  );
}

function Header(){
  return(
    <header>
      <h2>Selamat Datang di</h2>
      <h1>DigitalQ</h1>
      <a href="#about">CARI TAHU SEKARANG</a>
      <hr></hr>
    </header>
  );
}

function Section1(){
  return(
    <section id="about">
      <img src="2.jpg" width="30%" />
      <u>Sekilas Tentang Kami</u>
      <p><b>DigitalQ </b>merupakan toko elektronik terpercaya yang menjual bervariasi laptop dan handphone berkualitas dengan harga terjangkau. DigitalQ siap menjamin kepuasan pelanggan.</p>
      <hr></hr>
    </section>
  );
}

function Section2(){
  return(
    <section id="product">
      <h2>PRODUK</h2>
      <h3>Apa yang Anda Cari?</h3>
      <p><a href="produk#laptop"><b>LAPTOP</b></a></p>          
      <p><a href="produk#hp"><b>HANDPHONE</b></a></p>
      <p><a href="produk#dll"><b>PRINTER & AKSESORIS</b></a></p>
    </section>
  );
}

function Section3(){
  return(
    <section>
      <ul>
        <li><a href="produk#laptop"><img src="A.jpg" /></a></li>
        <li><a href="produk#hp"><img src="B.jpg" /></a></li>
        <li><a href="produk#dll"><img src="C.jpg" /></a></li>
        <li><a href="produk#dll"><img src="D.jpg" /></a></li>
        <li><a href="produk#dll"><img src="E.jpg" /></a></li>
        <li><a href="produk#dll"><img src="F.jpg" /></a></li>
      </ul>
      <hr></hr>
    </section>
  );
}

function Footer(){
  return(
    <footer id="contact">
      <p><b>HUBUNGI KAMI</b></p>
        <ul>
          <li>082 345 678 910</li>
          <li>email : digital1@gmail.com</li>
        </ul>
      <p><b>KUNJUNGI KAMI</b></p>
        <ul>
          <li>Jl. Ahmad Yani, Banyuwangi, Jawa Timur</li>
        </ul>
      <p><b>PEMBAYARAN</b></p>
        <ul>
          <li><img src="bayar1.png" /></li>
          <li><img src="bayar2.png" /></li>
          <li><img src="bayar3.png" /></li>
          <li><img src="bayar4.png" /></li>
          <li><img src="bayar5.png" /></li>
        </ul>
      <p>© DigitalQ 2020. Hak Cipta Dilindungi</p>
      <p>Negara : Indonesia</p>
    </footer>
  );
}

class Beranda extends Component{
  render(){
    return (
      <div>
        <Navbar />
        <Header />
        <Section1 />
        <Section2 />
        <Section3 />
        <Footer/>
      </div>
    );
  }
}

export default Beranda;
